import React from 'react';
import './App.css';
import { Route, Switch } from 'react-router-dom'
import HomePage from './pages/home'

function App() {
  return (
    <div className="App">

      <Switch>
        <Route exact path="/" component={HomePage} />
      </Switch>

      <header className="App-header">
        <p> Hello World</p>
      </header>

    </div>
  );
}

export default App;
